description:
Category	Feature, Plot Based, Couples

Director	David Lord
Starring	Bree Olson, Tori Black, Ben English, Barrett Blade, Derrick Pierce, Chris Johnson, Mia Lelani, Jamie Lamore

Bree Olson has been a bad, bad girl! This all-natural beauty loves life in the fast lane, but her outrageous desires are catching up with her. She's on her way to prison for a crime she didn't commit, but for 24 hours she'll savor the thrill of high speed car chases, steal a fleet of luxury vehicles and enter a dangerous world of high velocity sex. There's no coming back from One Last Ride!


